def execute_plan(plan, initial_state):
    current_state = initial_state.copy()
    for action in plan:
        if all(precondition(current_state) for precondition in action['preconditions']):
            current_state = action['execute'](current_state)
            if not all(postcondition(current_state) for postcondition in action['postconditions']):
                raise Exception("Postcondition not met for action: " + action['name'])
    return current_state
